import React from 'react'

export default function Pager() 
{

//Empty_Array
var pagination=[];


for(let i=1;i<=20;i++)
{
    pagination.push(i)
}

    return (<>
       

            <div className="container w-50 mx-auto">
                        <nav>
                <ul className="pagination">
                    {
                        pagination.map( (res,index)=>{
                            return(<li class="page-item" key={index}>
                                        <a class="page-link" href="#">
                                            {res}
                                        </a>
                                </li>)
                        })
                    }
                </ul>
            </nav>
            </div>


            </>)
}
